import React from 'react';

class PersonalData extends React.Component {
  render() {
    return (
      <fieldset>
        <label htmlFor="name">Nome:</label>
        <input
          type="text"
          name="name"
          id="input-name" 
        />
      </fieldset>
    );
  }
}

export default PersonalData;
